import React, { useState, useEffect } from 'react';
import Plot from 'react-plotly.js';
import yfinance from 'yfinance';

function Searchbar() {
    const [data, setData] = useState([]);

    useEffect(() => {
        yfinance
            .download('AAPL', '2020-01-01', '2021-01-01', { interval: '1d' })
            .then(response => {
                const candlestickData = {
                    x: response.index,
                    open: response.Open,
                    high: response.High,
                    low: response.Low,
                    close: response.Close,
                    type: 'candlestick',
                    name: 'AAPL',
                };
                setData([candlestickData]);
            })
            .catch(error => {
                console.error(error);
            });
    }, []);

    return (
        <div>
            <Plot
                data={data}
                layout={{
                    title: 'AAPL Candlestick Chart',
                    xaxis: {
                        title: 'Date',
                    },
                    yaxis: {
                        title: 'Price',
                    },
                }}
            />
        </div>
    );
}

export default Searchbar;
